import "./Tile.css"
import pawn_w from "../Components/Pieces/pawn_w"

interface props{
    num:number;
    x:string;
    y:string;
}

const Tile = ({num,x,y}: props) => {
//{X}{y}
    if(num%2 == 0)
    return(<div className="tile white-tile"><img src={pawn_w} /></div >)
    else 
    return(<div className="tile black-tile">{x}{y}</div >)
 
}

export default Tile
